create table EVENT (
	tag_id VARCHAR(9),
	reader_id VARCHAR(8),
	upc VARCHAR(3),
	event_timestamp DATE,
	curr_ts DATE,
	product_price DECIMAL(6,2),
	location VARCHAR(17),
	exit_event DECIMAL(10,2),
	event_status VARCHAR(9),
	product_image_url VARCHAR(50),
	product_name VARCHAR(3),
	store VARCHAR(2),
	matched VARCHAR(50),
	check_count INT,
	signal INT,
	name_id VARCHAR(50),
	video_url VARCHAR(50)
);
